import React from 'react';
import { Link } from 'react-router-dom';
import './Navbar.css';

const Navbar = () => {
    return (
        <div className="navbar">
            <Link to="/" className="navbar-item" activeClassName="active">Home</Link>
            <Link to="/about" className="navbar-item" activeClassName="active">About</Link>
            <Link to="/services" className="navbar-item" activeClassName="active">Services</Link>
            <Link to="/contact" className="navbar-item" activeClassName="active" activeStyle={{ color: 'red' }}>Contact</Link>
        </div>
    );
}

export default Navbar;
